import css from 'styled-jsx/css';

export default css`.product {
  position: relative;
  height: 1004px;
}
.product .card {
  display: inline-block;
  line-height: 100%;
  width: 183px;
  height: 162px;
  margin-top: 85px;
  margin-left: 7px;
  margin-right: 7px;
  border: 2px solid #c2dbfd;
  box-shadow: 0px 12px 23px 4px rgba(216, 223, 229, 0.3);
}
.product .center-pic {
  position: absolute;
  width: 787px;
  height: 628px;
  margin: -54px auto 0;
  left: 0px;
  right: 0px;
}
.feature-left {
  height: 701px;
}
`
